import React from 'react'
import './Header.css'
import MenuIcon from '@material-ui/icons/Menu';

function Header() {
    return (

        <div className=".header">
            <MenuIcon />
            <img classname="header__logo" src="https://seeklogo.com/images/I/imdb-logo-AF81176825-seeklogo.com.jpg " alt="" />
        </div>
    )
}

export default Header
